import React from "react";

const FullPokemonList = ({ pokemonData }) => {
  return (
    <>
      <div>
        <h2 className="font-bold text-2xl">Types:</h2>
        <ul>
          {pokemonData.map((item, index) => (
            <div>
              <div className="border" key={index}>
                {pokemonData[0].item.name}
                {pokemonData[0].item.id}
                <img src={pokemonData[0].item.sprites.front_default} alt="" />
                <img src={pokemonData[0].item.sprites.back_default} alt="" />
              </div>
            </div>
          ))}
        </ul>
      </div>
    </>
  );
};

export default FullPokemonList;
